// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

// ---------------- Minimal Entropy interfaces (self-contained) ----------------
interface IEntropyV2 {
    function getFeeV2() external view returns (uint128);
    function requestV2() external payable returns (uint64);
}

abstract contract IEntropyConsumer {
    // internal developer callback required to be implemented by consumer
    function entropyCallback(
        uint64 sequenceNumber,
        address provider,
        bytes32 randomNumber
    ) internal virtual;

    function getEntropy() internal view virtual returns (address);

    // External wrapper that the entropy provider will call.
    // It accepts bytes calldata, converts to bytes32, and forwards to internal callback.
    function entropyCallback(
        uint64 sequenceNumber,
        address provider,
        bytes calldata randomNumber
    ) external {
        require(msg.sender == getEntropy(), "Only entropy contract allowed");
        bytes32 rn;
        assembly {
            // read first 32 bytes of calldata for the bytes param
            rn := calldataload(add(randomNumber.offset, 0))
        }
        entropyCallback(sequenceNumber, provider, rn);
    }
}

// --------------------------- RewardEntropy contract ---------------------------
contract RewardEntropy is IEntropyConsumer {
    IEntropyV2 public entropy;
    address public relayer;

    mapping(uint64 => address) public userBySequence;

    event RewardRequested(uint64 indexed sequence, address indexed user);
    event RewardAssigned(uint64 indexed sequence, address indexed user, uint256 reward);

    constructor(address entropyAddress, address relayerAddress) {
        require(entropyAddress != address(0), "entropy=0");
        require(relayerAddress != address(0), "relayer=0");
        entropy = IEntropyV2(entropyAddress);
        relayer = relayerAddress;
    }

    // required override
    function getEntropy() internal view override returns (address) {
        return address(entropy);
    }

    // Relayer-only function: send fee and request randomness
    function requestReward(address user) external payable returns (uint64) {
        require(msg.sender == relayer, "ONLY RELAYER");
        require(user != address(0), "user=0");

        uint128 fee = entropy.getFeeV2();
        require(msg.value >= fee, "FEE TOO LOW");

        uint64 seq = entropy.requestV2{ value: fee }();
        userBySequence[seq] = user;

        emit RewardRequested(seq, user);
        return seq;
    }

    // Internal callback invoked via the external wrapper
    function entropyCallback(
        uint64 sequenceNumber,
        address,
        bytes32 randomNumber
    ) internal override {
        address user = userBySequence[sequenceNumber];

        if (user == address(0)) {
            // no user stored (maybe already handled) â€” just clean up
            delete userBySequence[sequenceNumber];
            return;
        }

        uint256 reward = (uint256(randomNumber) % 100) + 1;
        emit RewardAssigned(sequenceNumber, user, reward);

        delete userBySequence[sequenceNumber];
    }

    // Allow the contract to receive ETH (top-up)
    receive() external payable {}
}

